BPS dan BIG berperan sebagai Pembina Data. Betul, BIG berperan besar sbg Pembina Data untuk Simpul Jaringan. Jika ada peran lebih lanjut untuk BPS ditentukan selanjutnya dalam Forum Data. Adapun Kesber antara Pemdaprov Jabar dg BPS Jabar bisa dilihat dalam Kesber tentang Penyediaan, Pengembangan dan Pemanfaatan Data serta Informasi Statistik untuk Pembangunan Daerah Provinsi Jawa Barat.

